@dev 오직 1씩만 증가 또는 감소할 수 있는 카운터(counter)를 제공합니다. 이는 가령 매핑의 원소 수 추적,
ERC721 ID 발행, 또는 요청 ID 개수를 세는 데 사용할 수 있습니다.
